import React, {Component} from 'react';

import './itemAddForm.css'

export default class ItemAddForm extends Component{
    render(){
        return(
            <div className='item-add-form'>
            <button className='btn btn-outline-secondary'>Add Item</button> 

            </div>
        )
    }
}
